import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import App from "./App";
import * as serviceWorker from "./serviceWorker";

const divStyle = {
  margin: "40px",
  border: "5px solid pink"
};

const pStyle = {
  color: "red",
  fontSize: "15px",
  textAlign: "center"
};

function MyInfo() {
  return (
    <div style={divStyle}>
      <h1>Ronak Gune</h1>
      <p style={pStyle}>
        I am a recent graduate from SCU and am looking for new opportunities.
      </p>
      <ol>
        <li>Mallorca</li>
        <li>Cannes</li>
        <li>Bali</li>
      </ol>
    </div>
  );
}
ReactDOM.render(<MyInfo />, document.getElementById("root"));
serviceWorker.unregister();
